include_once($__appvar["basedir"]."/html/rapport/rapportVertaal.php");

class RapportFRONTC_L33
{
	function RapportFRONTC_L33($pdf, $portefeuille, $rapportageDatumVanaf, $rapportageDatum)
	{
		$this->pdf = &$pdf;
		$this->pdf->rapport_type = "FRONT";
		$this->pdf->rapport_datum = db2jul($rapportageDatum);

		if($this->pdf->rapport_FRONT_titel)
			$this->pdf->rapport_titel = $this->pdf->rapport_FRONT_titel;

		$this->portefeuille = $portefeuille;
		$this->rapportageDatumVanaf = $rapportageDatumVanaf;
		$this->rapportageDatumVanafJul=db2jul($this->rapportageDatumVanaf);
		$this->rapportageDatum = $rapportageDatum;
		$this->rapportageDatumJul=db2jul($this->rapportageDatum);
		$this->pdf->extraPage =0;
		$this->DB = new DB();

		$this->rapportMaand 	= date("n",$this->rapportageDatumJul);
		$this->rapportDag 		= date("d",$this->rapportageDatumJul);
		$this->rapportJaar 		= date("Y",$this->rapportageDatumJul);

		$this->pdf->brief_font = $this->pdf->rapport_font;
    //$this->logoFront=base64_decode('');
    $this->logoFront=base64_decode('');
    //$this->voetFront=base64_decode('');

	}



	function writeRapport()
	{
	  global $__appvar;

	  $this->pdf->frontPage=true;
    $this->pdf->last_rapport_type="FRONT";
		unset($this->pdf->pageTop);
		unset($this->pdf->pageBottom);
	  $this->pdf->addPage('L');


	  $imageWidth=130;
    $this->pdf->MemImage($this->logoFront,297/2-$imageWidth/2,12,$imageWidth);
    //$this->pdf->MemImage($this->voetFront,297/2-$imageWidth/2,200,$imageWidth);
		$this->pdf->SetWidths(array(25,140));
	  $this->pdf->SetAligns(array('R','L'));
  //  $this->pdf->rowHeight = 5;


    $rapportagePeriode = date("d",$this->rapportageDatumVanafJul)." ".
		                                          vertaalTekst($__appvar["Maanden"][date("n",$this->rapportageDatumVanafJul)],$this->pdf->rapport_taal)." ".
		                                          date("Y",$this->rapportageDatumVanafJul).
		                                          ' '.vertaalTekst('t/m',$this->pdf->rapport_taal).' '.
		                                          date("d",$this->rapportageDatumJul)." ".
		                                          vertaalTekst($__appvar["Maanden"][date("n",$this->rapportageDatumJul)],$this->pdf->rapport_taal)." ".
		                                          date("Y",$this->rapportageDatumJul);
                                                  
    $this->pdf->SetDrawColor($this->pdf->kopkleur[0],$this->pdf->kopkleur[1],$this->pdf->kopkleur[2]);
//$this->pdf->SetFillColor($this->pdf->kopkleur[0],$this->pdf->kopkleur[1],$this->pdf->kopkleur[2]);
//$this->pdf->Rect(0,60,297,50,'DF','',$this->pdf->kopkleur);
    $this->pdf->Line(0,54.23,297,54.23);
    $this->pdf->Line(0,113.57,297,113.57);

  	$this->pdf->SetWidths(array(297-(2*$this->pdf->marge)));
  	$this->pdf->SetAligns(array('C'));
  	$this->pdf->SetY(70);
    $this->pdf->SetTextColor($this->pdf->kopkleur[0],$this->pdf->kopkleur[1],$this->pdf->kopkleur[2]);
  	$this->pdf->SetFont($this->pdf->rapport_font,'B',18);
	  $this->pdf->row(array(strtoupper(vertaalTekst("Vermogensrapportage",$this->pdf->rapport_taal))));
    $this->pdf->SetTextColor(0,0,0);
    $this->pdf->SetFont($this->pdf->rapport_font,'',10);
    $this->pdf->Ln(5);
    $this->pdf->row(array(vertaalTekst('Rapportageperiode',$this->pdf->rapport_taal).' '.$rapportagePeriode));
	  $this->pdf->SetY(87);
	  $this->pdf->SetFont($this->pdf->rapport_font,'',14);
    $this->pdf->Ln(5);
    
    
    
    
    if($this->pdf->__appvar['consolidatie']['rekeningOnderdrukken'])
		{
  		$naam1=$this->pdf->__appvar['consolidatie']['portefeuillenaam1'];
  		$naam2=$this->pdf->__appvar['consolidatie']['portefeuillenaam2'];
		}   
      if($naam1=='')
        $naam1=strtoupper(vertaalTekst("geconsolideerd",$this->pdf->rapport_taal));
        
        
        

        
	  $this->pdf->row(array($naam1));   

		$this->pdf->SetWidths(array(25,140));
	  $this->pdf->SetAligns(array('R','L'));
    $this->pdf->rowHeight = 5;

    $portefeuilledata=array();

		$query = "SELECT
	            	if(Vermogensbeheerders.CrmPortefeuilleInformatie=1,CRM_naw.naam,Clienten.Naam) as Naam,
                if(Vermogensbeheerders.CrmPortefeuilleInformatie=1,CRM_naw.naam1,Clienten.Naam1) as Naam1,
                Clienten.Adres,
                Clienten.Woonplaats,
                Portefeuilles.Portefeuille,
                Portefeuilles.Depotbank,
                Portefeuilles.PortefeuilleVoorzet,
                Accountmanagers.Naam as accountManager,
                Vermogensbeheerders.Telefoon,
                Vermogensbeheerders.Fax,
                Vermogensbeheerders.Email,
                Depotbanken.Omschrijving as depotbankOmschrijving
		          FROM
		            Portefeuilles
		            LEFT JOIN Clienten ON Portefeuilles.Client = Clienten.Client
		            LEFT JOIN Accountmanagers ON Portefeuilles.Accountmanager = Accountmanagers.Accountmanager
		            LEFT JOIN Vermogensbeheerders ON Portefeuilles.Vermogensbeheerder = Vermogensbeheerders.Vermogensbeheerder
		            LEFT Join CRM_naw ON Portefeuilles.Portefeuille = CRM_naw.portefeuille
		            Join Depotbanken ON Portefeuilles.Depotbank = Depotbanken.Depotbank
		          WHERE
		            Portefeuilles.Portefeuille IN('".implode("','",$this->pdf->portefeuilles)."')
              ORDER BY depotbankOmschrijving,Portefeuilles.Portefeuille";

		$this->DB->SQL($query);
		$this->DB->Query();
    while($data=$this->DB->nextRecord())
	    $portefeuilledata[] = $data;

	



$this->pdf->SetDrawColor(0,0,0);
$this->pdf->SetFillColor(0,0,0);

    $this->pdf->SetFont($this->pdf->rapport_font,'',$this->pdf->rapport_fontsize+2);

  	
	  $this->pdf->SetY(120);

$this->pdf->SetTextColor(0,0,0);
	  $this->pdf->SetWidths(array(20,80,55,55));
$this->pdf->SetAligns(array('L','L','L','L'));
	  foreach ($portefeuilledata as $pdata)
    {
     if($this->pdf->lastPOST['anoniem'])
	     $this->pdf->row(array('','',$pdata['depotbankOmschrijving'],$pdata['PortefeuilleVoorzet'].$pdata['Portefeuille']));
     else
       $this->pdf->row(array('',$pdata['Naam'],$pdata['depotbankOmschrijving'],$pdata['PortefeuilleVoorzet'].$pdata['Portefeuille']));
    }

    $this->pdf->SetWidths(array(20,100));
    $this->pdf->SetY(175);
    $this->pdf->row(array('',vertaalTekst('Datum',$this->pdf->rapport_taal).' '.(date("d"))." ".vertaalTekst($__appvar["Maanden"][date("n")],$pdf->rapport_taal)." ".date("Y")));

    $b=$this->pdf->PageBreakTrigger;
    $this->pdf->SetY(200);
    $this->pdf->PageBreakTrigger=210;
  	$this->pdf->SetWidths(array(297-(2*$this->pdf->marge)));
  	$this->pdf->SetAligns(array('C'));
    $this->pdf->SetTextColor($this->pdf->kopkleur[0],$this->pdf->kopkleur[1],$this->pdf->kopkleur[2]);
  	$this->pdf->SetFont($this->pdf->rapport_font,'',9.5);
	  //$this->pdf->row(array("J.J. Viottastraat 35 | 1071 JP  AMSTERDAM | T 020 712 99 99 | www.bavandoorn.nl"));
    $this->pdf->row(array($this->pdf->portefeuilledata['VermogensbeheerderAdres']." | ".$this->pdf->portefeuilledata['VermogensbeheerderWoonplaats']." | T ".$this->pdf->portefeuilledata['VermogensbeheerderTelefoon']." | ".str_replace(array('http://','/'),array('',''),$this->pdf->portefeuilledata['VermogensbeheerderWebsite'])));
    
    $this->pdf->SetTextColor(0,0,0);
    $this->pdf->PageBreakTrigger=$b;
    $this->pdf->SetDrawColor(0,0,0);
    $this->pdf->SetFillColor(0,0,0);

	  $this->pdf->frontPage=true;
	  $this->pdf->rapport_type = "OIB";
	  $this->pdf->rapport_titel = "";//Inhoudsopgave
	  $this->pdf->addPage('L');
	  $this->pdf->templateVars['inhoudsPagina']=$this->pdf->page;

	//	listarray($vermogensbeheerder);
  //  listarray($this->pdf->portefeuilledata);
	}
}
